CREATE SEQUENCE localgisguiaurbana.markersequence INCREMENT BY 1 NO MAXVALUE NO MINVALUE CACHE 1;			
ALTER TABLE localgisguiaurbana.markersequence OWNER TO guiaurbana;
DROP TABLE localgisguiaurbana.marker;
CREATE TABLE localgisguiaurbana.marker
(
  markerid integer NOT NULL,
  mapid integer NOT NULL,
  username character varying (100) NOT NULL,
  x double precision NOT NULL,
  y double precision NOT NULL,
  scale double precision NOT NULL,
  markname character varying(100) NOT NULL,
  marktext text,
  
  CONSTRAINT pk_marker PRIMARY KEY (markerid),
  CONSTRAINT fk_marker_map FOREIGN KEY (mapid)
      REFERENCES localgisguiaurbana.map (mapid) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE CASCADE
)
WITH OIDS;

ALTER TABLE localgisguiaurbana.marker OWNER TO geopista;
